import React, { useEffect, useState } from "react";
import { motion } from "framer-motion";
import { useInView } from "react-intersection-observer";

type CounterProps = {
  endValue: number;
  suffix?: string;
  label: string;
  svg: React.ReactNode;
};

function Counter({ endValue, suffix, label, svg }: CounterProps) {
  const [count, setCount] = useState(0);
  // const [hasAnimated, setHasAnimated] = useState(false);
  const { ref, inView, entry } = useInView({
    triggerOnce: false,
    threshold: 0.3,
  });

  useEffect(() => {
    if (inView) {
      let start = 0;
      setCount(0); //reset
      const duration = 1000;
      const stepTime = Math.floor(duration / endValue);

      const timer = setInterval(() => {
        start += 1;
        setCount(start);
        if (start >= endValue) clearInterval(timer);
      }, stepTime);
    }
  }, [inView, endValue]);

  return (
    <motion.div
      ref={ref}
      className="flex flex-col justify-between items-center gap-4 text-white px-6"
      initial={{ opacity: 0, y: 20 }}
      animate={inView ? { opacity: 1, y: 0 } : {}}
      transition={{ duration: 2 }}
    >
      <div className="">{svg}</div>

      <div className="flex  pt-2 sm:pt-5 gap-2 sm:gap-4  whitespace-nowrap">
        <p className="text-2xl font-semibold sm:text-5xl leading-none">
          <span>{count}</span>
          {suffix}
        </p>
        <p className="text-sm font-light opacity-70 sm:text-xl">{label}</p>
      </div>
    </motion.div>
  );
}

